con:mockOperation.con:dispatchPath:
def isMatch = false;
def responseToDispatch = 'ProvidePrescriptionDrugHistory Response - NotFound'
def errorMessage = ''

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def path = groovyUtils.projectPath + '\\'

def logFilePath = path +  'State - Log.txt'
def logFile = new File( logFilePath )

def parsingFilePath = path  +   'State - Parsing.csv'
def parsingFile = new File( parsingFilePath )

def dispatchingFilePath =  path + 'State - Dispatching.csv'
def dispatchingFile = new File( dispatchingFilePath )

def soapRequestHolder = new com.eviware.soapui.support.XmlHolder(mockRequest.requestContent)

if(soapRequestHolder == null) 
{
	errorMessage = 'Invalid Request'
	responseToDispatch = "ProvidePrescriptionDrugHistory Response - Fault" 
	requestContext.error = errorMessage
	logFile.append(errorMessage + '\n')
	logFile.append('Response = ' + responseToDispatch + '\n')
	logFile.append('----------------------\n')
	return responseToDispatch
}

soapRequestHolder.namespaces["pmix"]="http://www.pmix.gov"
log.info soapRequestHolder.getXml()

// Parsing Data
def parsingmap = [:]
def parsingBufferReader = new BufferedReader( new FileReader(parsingFile));
def eachLine = "";
while( (eachLine = parsingBufferReader.readLine()) != null)
{
	def allColumns = eachLine.split(',')
	parsingmap[allColumns[0]] = allColumns[1] 
}

def requestor = soapRequestHolder[parsingmap['Requestor']]
def requestorRole = soapRequestHolder[parsingmap['RequestorRole']]
def requestorSOR = soapRequestHolder[parsingmap['DisclosingState']]
def requestID = soapRequestHolder[parsingmap['RequestID']]
def requestSOI = soapRequestHolder[parsingmap['RequestingState']]

logFile.append( 'Request ID = ' + requestID + ', Requestor = ' + requestor + ', Requestor Role = ' + requestorRole + ', Disclosing State = ' + requestorSOR + ', Requesting State = ' + requestSOI + '\n')

if(requestorSOR =='XX')
{
	errorMessage = 'The Disclosing State is not authorized.'
	responseToDispatch = "ProvidePrescriptionDrugHistory Response - Fault - Auth" 
	requestContext.error = errorMessage
	logFile.append(errorMessage + '\n')
	logFile.append('Response = ' + responseToDispatch + '\n')
	logFile.append('----------------------\n')
	return  responseToDispatch
}

// Body Data
def requestDataPath = parsingmap['RequestData']

// used for non-encryption based message (i.e. CDATA)
def requestXML = soapRequestHolder[parsingmap['RequestData']]
// used for initial encryption based message (i.e. no CDATA)
//def requestXML = soapRequestHolder.getDomNode( requestDataPath )

if(requestXML == null)
{
	errorMessage = 'Invalid Request: No RequestData!'
	responseToDispatch = "ProvidePrescriptionDrugHistory Response - Fault" 
	requestContext.error = errorMessage
	logFile.append(errorMessage + '\n')
	logFile.append('Response = ' + responseToDispatch + '\n')
	logFile.append('----------------------\n')
	return responseToDispatch
}

def bodyHolder = new com.eviware.soapui.support.XmlHolder(requestXML)
if(bodyHolder == null)
{
	errorMessage = 'Invalid Request'
	responseToDispatch = "ProvidePrescriptionDrugHistory Response - Fault" 
	requestContext.error = errorMessage
	logFile.append(errorMessage + '\n' + requestXML + '\n')
	logFile.append('Response = ' + responseToDispatch + '\n')
	logFile.append('----------------------\n')
	return responseToDispatch
}

//bodyHolder.namespaces["pmix"]="http://www.pmix.gov"
//bodyHolder.namespaces["pmp"]="http://xml.ijis.org/niem/2.0/extension"
//bodyHolder.namespaces["nc"]="http://niem.gov/niem/niem-core/2.0"

if(bodyHolder.containsKey(parsingmap['Request.LastName']) == false)
{
	errorMessage = 'Last Name not provided'
	responseToDispatch = "ProvidePrescriptionDrugHistory Response - Fault" 
	requestContext.error = errorMessage
	logFile.append(errorMessage + '\n')
	logFile.append('Response = ' + responseToDispatch + '\n')
	logFile.append('----------------------\n')
	return responseToDispatch
}	

// Dispatching Data
def dipatchingBufferReader = new BufferedReader( new FileReader(dispatchingFile))
def eachdispatchLine = ""
def lineCount = 0
while( (eachdispatchLine = dipatchingBufferReader.readLine()) != null)
{
	lineCount = lineCount + 1
	def rulesAndresponse = eachdispatchLine.split('=>')
	def rules = rulesAndresponse[0]
	def response = rulesAndresponse[1]

	def allRules = rules.split('&&')
	for(i = 0; i < allRules.size(); i++)
	{
		def ruleParts = allRules[i].split('==')
		def ruleLeftPart = ruleParts[0]
		def ruleRightPart = ruleParts[1]

		if(parsingmap.containsKey(ruleLeftPart))
		{
			def xpath = parsingmap[ruleLeftPart]	
			def currentValue = bodyHolder[xpath]
			def toMatchValue = ruleRightPart

			logFile.append(lineCount + '. Field = ' + ruleLeftPart + ', XMLValue = ' + currentValue + ', RuleValue = ' + toMatchValue )

			if(toMatchValue == currentValue)
			{
				logFile.append(' => Match\n' )
				isMatch = true;	
			}
			else
			{
				logFile.append(' => NO Match\n' )
				isMatch = false;
				break;
			}
		}
	}

	if(isMatch == true)
	{
		responseToDispatch = response
		break;
	}
}

logFile.append('Response = ' + responseToDispatch + '\n')
logFile.append('----------------------\n')


requestContext.disclosingState = requestorSOR
requestContext.requestID = requestID
requestContext.requestState = requestSOI

return responseToDispatch
